import { Card, CardContent, Typography } from "@mui/material";
import React from "react";
import './Counter.css';

function Counter() {
  return (
    <div style={{ display: "flex", justifyContent: "center", width: "100%" , marginTop:"89.63px"}}>
      <Card className="counterCards" sx={{ width: "268px", height: "268px", marginRight:"65.14px", borderRadius:''}}>
        <CardContent sx={{ textAlign: "center" }}>
          <Typography sx={{ fontSize: "93.06px", fontWeight: "700" }}>
            6
          </Typography>
          <Typography>Years in Field</Typography>
        </CardContent>
      </Card>
      <Card sx={{ width: "268px", height: "268px",marginRight:"65.14px" }}>
        <CardContent sx={{ textAlign: "center" }}>
          <Typography sx={{ fontSize: "93.06px", fontWeight: "700" }}>10+</Typography>
          <Typography>Expertes</Typography>{" "}
        </CardContent>
      </Card>
      <Card sx={{ width: "268px", height: "268px",marginRight:"65.14px" }}>
        <CardContent sx={{ textAlign: "center" }}>
          <Typography sx={{ fontSize: "93.06px", fontWeight: "700" }}>50+</Typography>
          <Typography>Prpjects</Typography>{" "}
        </CardContent>
      </Card>
      <Card sx={{ width: "268px", height: "268px" }}    >
        <CardContent sx={{ textAlign: "center" }}>
          <Typography sx={{ fontSize: "93.06px", fontWeight: "700" }}>20+</Typography>
          <Typography>Agency Partners</Typography>{" "}
        </CardContent>
      </Card>
    </div>
  );
}

export default Counter;
